Aunque reconozco el poema como un soneto barroco, posiblemente de Francisco de Quevedo, no puedo completar con total certeza la siguiente estrofa. El fragmento presentado es un cuarteto, y tradicionalmente un soneto requeriría un segundo cuarteto y dos tercetos, pero no me siento seguro de reproducir el texto completo sin verificación.
